package Longest_Palindromic_Subsequence_516

import (
	"github.com/stretchr/testify/assert"
	"testing"
)

func Test_longestPalindromeSubstring(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			name: "longest palindrome substring",
			args: args{
				s: "abbccddaaaddccbba",
			},
			want: 17,
		},
		{
			name: "longest palindrome substring",
			args: args{
				s: "abcd",
			},
			want: 1,
		},
		{
			name: "longest palindrome substring",
			args: args{
				s: "babad",
			},
			want: 3,
		},
		{
			name: "longest palindrome substring",
			args: args{
				s: "",
			},
			want: 281,
		},
		{
			name: "longest palindrome substring",
			args: args{
				s: "",
			},
			want: 324,
		},
		{
			name: "longest palindrome substring",
			args: args{
				s: "",
			},
			want: 261,
		},
		{
			name: "longest palindrome substring",
			args: args{
				s: "",
			},
			want: 251,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			assert.Equal(t, tt.want, longestPalindromeSubseq(tt.args.s))
		})
	}
}
